import gql from "graphql-tag";

export const MY_BRANDS = gql`
      query MY_BRANDS {
            user {
                id
                  brands {
                        id
                        name
                        logo
                  }
            }
      }
`;

export const QUERY_BRANDS = gql`
      query {
            products {
                  id
                  name
                  description
                  price
                  imageUrl
                  createdAt
                  user {
                        id
                  }
            }
      }
`;
